import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import StoryTracker from '../components/StoryTracker';

const StoryTrackerPage = () => {
  return (
    <>
      <Header />
      <StoryTracker />
      <Footer />
    </>
  );
};

export default StoryTrackerPage;
